import React from "react";

const ClassCard = (props) => {
  return (
    <div class="ui cards">
      <div class="ui card">
        <div class="content">
          <div class="header">{props.classCode}</div>
          <div class="description">
            Leverage agile frameworks to provide a robust synopsis for high
            level overviews.
          </div>
        </div>
      </div>
    </div>
  );
};

export default ClassCard;
